import React from "react";

const Gallery = () => {

  return (

  	<div class="row center">
  		<div class="col s-4"><img src={require("../assets/images/gallery1.jpeg")} style={{width:"50%"}}/></div>
  		<div class="col s-4 center"><img src={require("../assets/images/gallery1.jpeg")} style={{width:"50%"}}/></div>
  		<div class="col s-4 right"><img src={require("../assets/images/gallery1.jpeg")} style={{width:"50%"}}/></div>
  	</div>
  )
};

export default Gallery;
